"use strict";

import SvgIcon from "../../SvgIcon";
import { modified } from "../../svgDefinitions";

/**
 * The Modified icon class constructor
 * @class Modified
 * @extends SvgIcon
 */
export default class Modified extends SvgIcon {
    /**
     * @inheritDoc
     */
    get _name() {
        return "Modified";
    }

    /**
     * @inheritDoc
     */
    initialProps() {
        const props = super.initialProps();
        return Object.assign(props, {
            defaultClassNames: `${props.defaultClassNames} mpageui-SvgIcon-clinical-modified`
        });
    }

    /**
     * @inheritDoc
     */
    getSvg() {
        return modified;
    }
}
